import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './MarsRoverPhotos.css'; // Separate CSS for styling

const MarsRoverPhotos = () => {
  const [photos, setPhotos] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [page, setPage] = useState(1);
  const [rover, setRover] = useState('curiosity');
  const [camera, setCamera] = useState('navcam');
  const [sol, setSol] = useState(1000);

  const fetchPhotos = async () => {
    setLoading(true);
    setError(null);
    try {
      const response = await axios.get(
        `http://localhost:5000/mars-rover-photos?rover=${rover}&camera=${camera}&sol=${sol}&page=${page}`
      );
      setPhotos((prevPhotos) => [...prevPhotos, ...response.data.photos]);
    } catch (error) {
      setError('Error fetching Mars Rover photos');
      console.error('Error fetching Mars Rover photos:', error);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchPhotos();
  }, [page, rover, camera, sol]);

  return (
    <div className="mars-rover-container">
      <h1>Mars Rover Photos</h1>

      {/* Filter Section */}
      <div className="filters">
        <div className="filter">
          <label htmlFor="rover">Select Rover</label>
          <select id="rover" value={rover} onChange={(e) => setRover(e.target.value)}>
            <option value="curiosity">Curiosity</option>
            <option value="opportunity">Opportunity</option>
            <option value="spirit">Spirit</option>
          </select>
        </div>

        <div className="filter">
          <label htmlFor="camera">Select Camera</label>
          <select id="camera" value={camera} onChange={(e) => setCamera(e.target.value)}>
            <option value="navcam">Navcam</option>
            <option value="fhaz">FHAZ</option>
            <option value="rhaz">RHAZ</option>
            <option value="mast">Mastcam</option>
          </select>
        </div>

        <div className="filter">
          <label htmlFor="sol">Select Sol</label>
          <input
            type="number"
            id="sol"
            value={sol}
            onChange={(e) => setSol(e.target.value)}
            min="1000"
            max="3000"
          />
        </div>
      </div>

      {/* Loading Spinner */}
      {loading && <p className="loading">Loading...</p>}

      {/* Error message */}
      {error && <p className="error">{error}</p>}

      {/* Photo Grid */}
      <div className="photo-grid">
        {photos.map((photo) => (
          <div className="photo-card" key={photo.id}>
            <img
              src={photo.img_src}
              alt={`Mars Rover ${photo.id}`}
              className="photo"
              onClick={() => window.open(photo.img_src, '_blank')}
            />
            <p>Photo ID: {photo.id}</p>
          </div>
        ))}
      </div>

      {/* Load More Button */}
      {!loading && (
        <button className="load-more-btn" onClick={() => setPage((prevPage) => prevPage + 1)}>
          Load More Photos
        </button>
      )}
    </div>
  );
};

export default MarsRoverPhotos;
